import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="nav-wrapper blue draken-3">
      <div className="container">
        <Link to="/" className="brand-logo" style={{ position: "fi" }}>
          INventory
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
